// ACTION TYPE
export const GET_LOGOUT = 'GET_LOGOUT';
export const GET_TOGGLE = 'GET_TOGGLE';

// ACTION CREATOR
export const getLogout = () => ({
  type: GET_LOGOUT,
});

export const getToggle = () => ({
    type: GET_TOGGLE,
  });
